import React from "react";
import "./Board.css";
import PostBox from "./postBox";
//PostBox를 그려줍니다.
function PostList({ live, postList, seedetial, goBack }) {
  console.log(postList);
  //여기에서 넘어오는 postList부분을 반복 해줘야 할듯
  // 밑에서 postList[0]으로 처리하면 0 page만 지속적으로 처리되어짐

  return (
    <div className="list">
      {postList &&
        postList.map((post, idx) => (
          <React.Fragment key={idx}>
            {post.map((pet, ide) =>
              post[ide].length - 1 === ide ? (
                <PostBox live={live} postList={pet} key={`calendar-week-${pet.id}`} seedetail={seedetial} goBack={goBack} />
              ) : (
                <PostBox postList={pet} key={`calendar-week-${pet.id}`} seedetail={seedetial} goBack={goBack} />
              )
            )}
            {/* {postList[0].length - 1 === idx ? (
              <PostBox live={live} postList={post} key={`calendar-week-${post.id}`} seedetail={seedetial} goBack={goBack} />
            ) : (
              <PostBox postList={post} key={`calendar-week-${post.id}`} seedetail={seedetial} goBack={goBack} />
            )} */}
          </React.Fragment>
        ))}
    </div>
  );
}
export default PostList;
